import React, { Component } from "react"


class Footer extends Component {
    constructor(){
        super()
        this.state={
            isLoggedIn: false
        }
    }
   render(){
       let wordDisplay = ''
       if(this.state.isLoggedIn){
        wordDisplay = "In"
       }else{
           wordDisplay = "Out"
       }
        return(
        <footer>
            <h2>You are currently logged {wordDisplay} </h2>
            <h3>This is the footer</h3>
        </footer>
    )
}
}

export default Footer
